import React, { Component } from "react";
import { Link, Router } from "@reach/router";
import PostFormOfBook from "./components/PostFormOfBook";
import "./App.css";
import Opo from "./components/opo";
class App extends Component {
  render() {
    return (

      <Router>

              <Opo/>

       <PostFormOfBook path="/"/>
      </Router>
    );
  }
}

export default App;
